import React from "react";
import "./Homepage.css";

function sayHello() {
  alert("You clicked me!");
}

function Homepage() {
  return (
    <div className="homepage">
      <div className="gcp">
        <a href="https://react.school" target="_blank">
          <button onClick={sayHello}>GCP</button>
        </a>
      </div>
    </div>
  );
}

export default Homepage;
